import React from "react";
import { Link } from "react-router-dom";

const Dcard = ({ item: { id, image, title, desc, } }) => {
  return (
    <>
      <div className="items">
        <div className="img">
          <img />

          <Link to="/">
            <i className="fas fa-external-link-alt"></i>
          </Link>
        </div>

        <div className="title">
          <h3></h3>
        </div>
      </div>
    </>
  );
};

export default Dcard;
